import React from "react";
import { Tile } from "../tile/Tile";

export const TileList = (props) => {
  return (
    <div>
      {props.arr.map(({ name, ...rest }, index) => (
        <Tile key={index} name={name} description={rest} />
      ))}
    </div>
  );
};
